// Juice Images
import immunityBoosterImg from './immunity-booster.png';

// Image metadata
export const juiceImages = {
  immunityBooster: {
    src: immunityBoosterImg,
    alt: 'Immunity Booster Juice',
    description: 'Fresh orange juice with ginger and mint, rich in vitamin C',
    ingredients: ['Orange', 'Ginger', 'Carrot', 'Mint leaves'],
    benefits: [
      'Boosts immune system',
      'Rich in Vitamin C',
      'Anti-inflammatory properties',
      'Improves digestion'
    ]
  }
};
